descriptionEnglish:
JH880 is a functional tape made by treating washi paper (impregnation, release treatment, etc.) and coating it with a solvent-based pressure-sensitive adhesive.
It has excellent solvent/nitro resistance, good temperature resistance, strong UV resistance, good waterproof performance, and good splitting performance.
Applications:
Masking for painting and baking in automobile, ship and aircraft manufacturing;
Bundling and masking in furniture, woodworking, and home industries;
Used in electronics manufacturing and other industries for high-temperature fixation, protection and masking;
In electronics: solder-spray protection, PCB masking protection, and wave soldering protection for printed circuit boards.
JH880 is a general-purpose washi tape.
Color: dark yellow.
Temperature resistance (stainless steel plate): 120℃ for 1 hour.
